import './index.css'
import side_menu from './components/side_menu';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
      <side_menu />
      <switch>
        <Route path='/' />
      </switch>
    </Router>

    </>
  );
}

export default App;
